import './Ticker.css';

const Ticker = () => {
    const handleRedirect = (url) => {
        window.open(url, '_blank', 'noopener,noreferrer');
    };

    return (
        <div className="Ticker">
            <div className="ticker">
                <h2 className="slideInOut">Limited Sale Shop Before It's Gone!</h2>
            </div>
        </div>
    );
}

export default Ticker;
